    const classes = {
        margin: '1%'
    }


    const getChips = () => {
        const hobbies = ['exercise', 'nutrition', 'reading', 'writing', 'yoga','guitar', 'mediation',
                'programming', 'piano', 'deep reflections', 'learning', 'building/creating', 'playing sports']
        this.hobbies.map(label =>{
            return <Chip label={label} color="primary" style={classes} />
        })

        }

    return (
        <Card>
            <CardContent>
                <Typography color="textSecondary" variant="h4">
                    Hobbies and Interests
                </Typography>
                <Typography variant="body1" component="p">
                   {getChips()}
                </Typography>
            </CardContent>
        </Card>
    )
}
